import React, { Component } from 'react';
import logo from '../logo.svg';
import {Link} from 'react-router-dom';
import Button from './nesessaryElements/Button';

class Navebars extends Component {
    render() {
        return (
            
                <nav className="navbar navbar-expand-sm navbar-light sticky-top"  style={{backgroundColor: '#e3f2fd'}}>
                    <div className="container">
                        <div className="row">
                            <Link to='/'>
                                <img src={logo} className="navbar-brand img-fluid" alt="Logo Images"/>
                            </Link>
                            
                            <ul className="navbar-nav mr-auto ml-5 align-items-center">
                                <li className="nav-item active">
                                    <Link to='/' className="nav-link p-2">Product</Link>
                                </li>
                                <li className="nav-item active">
                                    <Link to='/' className="nav-link p-2">Product</Link>
                                </li>
                                <li className="nav-item active">
                                    <Link to='/' className="nav-link p-2">Product</Link>
                                </li>
                            </ul>
                            
                            <Link to='/carts' className="d-flex align-items-end">
                                <Button />
                                <Button />
                            </Link>
                        </div>    
                    </div>
                </nav>
            
            
        );
    }
}

export default Navebars;
